insert into chemin_traverse_traduction (nom,description,langue,produit) 
values ('Acacia', "difficile à utiliser, très sélectif du sorcier qu il choisit et préfère les sorciers doués",1,1);
insert into chemin_traverse_traduction (nom,description,langue,produit)
values ('Acajou', "efficace pour la métamorphose.",1,2);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values ('Aubépine', "assez contradictoire, peu autant exceller dans les sorts de guérisons que dans les maléfices, convient aux sorciers de nature conflictuelle.",1,3);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Aulne' , "bois très rigide qui aime les sorciers au tempérament opposé au sien, très bien adapté aux sortilèges informulés.",1,4);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Cèdre' , "synonyme de force de caractère et de loyauté.",1,5);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Cerisier' , "possède un pouvoir mortel, nécessite une maîtrise de soi et une force mentale exceptionnelle.",1,6);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Charme' , "raffiné et sensible, choisit les sorciers passionnés.",1,7);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Châtaignier' , "bois au caractère changeant, très influencé par le cœur avec lequel il compose une baguette et par la personnalité de son propriétaire.",1,8);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Chêne blanc' , "loyal, exige force, courage et fidélité de la part de son sorcier et s'associe bien aux sorciers dotés d'une puissante intuition et d'une grande affinité avec la nature.",1,9);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Chêne rouge' , "idéal pour le duel, aime les sorciers rapides, convient parfaitement aux sorciers à l'esprit vif et adaptable.",1,10);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Cornouiller' , "bois espiègle et malicieux qui est affilié aux sorciers pouvant les amener dans de nombreuses situations amusantes ou excitantes, produit des baguettes plutôt bruyantes.",1,11);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Cyprès' , "associé à la noblesse, convient aux braves et aux audacieux.",1,12);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Ébène' , "fait pour les propriétaires fidèle à leurs convictions et qui ont le courage d'être eux-mêmes.",1,13);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Épicéa' , "demande de la poigne et de la conviction de la part de son propriétaire.",1,14);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Érable' , "aime l'ambition, parfait pour les voyageurs et les explorateurs qui désirent des défis et des changements de décor fréquents.",1,15);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
