insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Hêtre' , "bénéficie d'une excellente réputation mais demande une certaine sagesse de la part de son possesseur.",1,17);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Houx' , "un bois rare doté d'un pouvoir protecteur qui aime choisir les sorciers dans des quêtes périlleuses.",1,18);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
