values (
    'Peuplier' , "utile aux sorciers dotés d'une vision morale claire.",1,26);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Pin' , "apprécie la nouveauté et l'inventivité, très sensible au sortilèges informulés, choisira un sorcier indépendant, curieux, voire mystérieux.",1,27);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Poirier' , "plutôt résistant, choisit les sorciers bienveillants, généreux et sages.",1,28);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
