values (
    'Sureau' , "aime la puissance, extrêmement difficile à maîtriser.",1,35);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Sycomore' , "avide de découvertes et d'expériences, désire un propriétaire à son image : curieux, dynamique et aventureux.",1,36);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
    'Tilleul', "argenté : fait pour les sorciers possédant le don de divination ou de Legilimancie.",1,37);
insert into chemin_traverse_traduction (nom,description,langue,produit) 
values (
